import '../css/MenuBar.css';
import React from 'react';
import logo from '../resources/logo.png';

export default class MenuBar extends React.Component {
  render() {
    const { toggleVideoHistory } = this.props;
    return (
      <div id="menu-bar">
<p id="menu-bar-rules" class="tooltip">
  Rules
  <div class="tooltip-content">
    Here are the rules
  </div>
</p>
        <div id="yousub">
          <img src={`${logo}?${new Date().getTime()}`} alt="Logo" />
          <p>yousub.</p>
        </div>
        <div id="menu-bar-right" style={{ marginRight: "1rem" }}>
          <p id="menu-bar-history" onClick={toggleVideoHistory}>History</p>
          <p id="menu-bar-logout">Log out</p>
        </div>
      </div>
    );
  }
}
